import React from 'react';
import Link from 'next/link';

const Header = () => {
	return (
		<header className="w-full fixed px-12.5% py-5 flex items-center justify-between">
			<div>
				<h6 className="font-normal">RD</h6>
			</div>
			<div>
				<ul className="space-x-12">
					<li>
						<Link href="/">
							<a className="text-lg font-bold text-primary-text">Home</a>
						</Link>
					</li>
				</ul>
			</div>
		</header>
	);
};

export default Header;
